#!/usr/bin/env python3
# -*- coding: utf-8 -*-


class Solution:
    """ 超出输出限制 """
    def num_distinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        ls = len(s)
        lt = len(t)
        if ls < lt:
            return 0
        if s == t:
            return 1

        matrix = [[0 for i in range(lt)] for j in range(ls)]
        matrix[0][0] = int(s[0] == t[0])
        # print(matrix)
        m = 1
        while m < ls:
            matrix[m][0] = matrix[m - 1][0] + int(s[m] == t[0])
            n = 1
            while n < lt:
                matrix[m][n] = int(s[m] == t[n]) * matrix[m - 1][n - 1] \
                               + matrix[m - 1][n]
                n += 1
            m += 1
        # print(matrix)
        return matrix[ls - 1][lt - 1]


def main():
    solution = Solution()
    # print(solution.num_distinct("rabbbit", "rabbit"))
    # print(solution.num_distinct("babgbag", "bag"))
    print(solution.num_distinct(
        ""
        ,"rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"
    ))


if __name__ == '__main__':
    main()
